import React from "react";
import { Link, useLocation } from "react-router-dom";
import "./StickyBlockBox";

function StickyBlockBox(props) {
  const { list } = props;
  let location = useLocation();

  return (
    <div>
      <StickyBlockBox list={list} />
    </div>
  );
}
export default StickyBlockBox;
